import { pixabay } from '../config/index';

const loadImages = async () => {
  const { url, key } = pixabay;
  return await fetch(`${pixabay.url}?key={${pixabay.key}}q=yellow+flowers&image_type=photo`)
};

export default {
  loadImages
};
